import React from 'react';
import Mermaid from '@mermaid-js/react';

const MermaidERDiagram = ({ mermaidCode }) => {
  if (!mermaidCode) return <div>No ER Diagram data</div>;

  return (
    <div className="mermaid-container" style={{ overflowX: 'auto', background: '#f9f9f9', padding: '1rem' }}>
      <Mermaid chart={mermaidCode} />
    </div>
  );
};

export default MermaidERDiagram;
